import React from 'react';
import {
  BrowserRouter,
  Route,
  Routes,
  Navigate
} from "react-router-dom";

import Parties from './parties/pages/Parties';
import MainNavigation from './shared/Navigation/MainNavigation';
import NewParty from './parties/pages/NewParty';

import './App.css';


const App = () => {
  return (
    <BrowserRouter>
        <MainNavigation />
        <Routes>
          <Route path="parties" exact element={<Parties />} >
            <Route path="new" element={<NewParty />} />
          </Route>
        </Routes>
    </BrowserRouter>
  );
}

export default App;
